import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Home from './pages/Home.js';

function App() {
  return (
    <>

    <h1>Hi</h1>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={Home} />
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
